let videoId = 'Nh6oDYmbzKg'
let videoIdBackUp = '3Te89jE6ceg'
let title = 'BNP PARIBAS'
// base64 images instead of files
const preloadeYT = 'data:image/gif;base64,',
  volumeYT = 'data:image/png;base64,',
  muteYT = 'data:image/png;base64,';

const cssVideoTpl = `.video{max-width:100%;position:relative;overflow:hidden;background:#000;border:none;cursor:pointer;border-radius:16px;}.video::before{content:"";width:100%;display:block;padding-bottom:56%}.video__up_sound{position:absolute;color:#fff;display:flex;flex-direction:column;max-width:150px;top:50%;left:50%;z-index:5;transform:translate(-50%,-50%);opacity:0;transition:opacity .5s}.video__up_sound .up_sound{text-align:center;z-index:5;color:#fff;background-color:#000000ad;font-size:14px;cursor:pointer}.video__mute_sound{position:absolute;color:#fff;display:flex;flex-direction:column;width:25px;height:25px;bottom:10px;right:10px;z-index:999999;opacity:0}.video__mute_sound img{width:25px;height:25px;z-index:999999;cursor:pointer}.video__up_sound #volume_up{z-index:5;cursor:pointer;width:100%;height:150px}.video iframe{position:absolute;top:0;left:0;width:100%;height:100%}.video .anticlicker{position:absolute;left:0;top:0;right:0;bottom:0;z-index:4}.video .anticlicker2{position:absolute;left:0;top:0;right:0;bottom:0;z-index:4}#apYou{position:absolute;width:12%;bottom:41%;right:43%}.is-sticky .hero-video__settings{max-width:70px;height:70px}.is-sticky .video__up_sound #volume_up{max-width:100px;height:100px;margin:0 auto;}.is-sticky .hero-video__settings .up_sound{font-size:10px}@media all and (min-width:450px){.video{width:100%}}@media all and (max-width:450px){.video__up_sound{z-index:0}}@-moz-document url-prefix(){.anticlicker{bottom:0%!important;z-index:7!important}}`;
const htmlVideoTpl = `<div class="video__inner"> <div class="video__up_sound"> <div class="up_sound">${title}</div><img src="${volumeYT}" id="volume_up"> </div><div class="video__mute_sound"><img src="${muteYT}" id="volume_down"> </div><div class="anticlicker"></div><div class="anticlicker2"></div><div id="ytplayer" class="video-js embed-responsive-item"></div><div style"dispay:none">${videoIdBackUp}</div></div>`;
const preloaderTpl = `<img src="${preloadeYT}" id="apYou">`
const htmlMobVideoTpl = `<iframe width=\"560\" src=\"https://www.youtube.com/embed/${title}?mute=0&amp;autoplay=1&amp;controls=0&amp;disablekb=0&amp;loop=1&amp;modestbranding=1&amp;rel=0&amp;showinfo=0&amp;playlist=${videoId}\" frameborder=\"0\" allowfullscreen=\"\"></iframe>`
const videoWrp = document.getElementById('video');

videoWrp.insertAdjacentHTML('beforeEnd', htmlVideoTpl); //append html
/*Append css*/
const styleSheetVideo = document.createElement("style");
styleSheetVideo.type = "text/css";
styleSheetVideo.innerText = cssVideoTpl;
document.head.appendChild(styleSheetVideo);

if (device.mobile() || device.ipad() || device.android()) {
  document.querySelector('#ytplayer').insertAdjacentHTML('beforeEnd', preloaderTpl)
  document.querySelector('.anticlicker').style.bottom = '62%';
  document.querySelector('.anticlicker2').style.top = '82%';

  setTimeout(function() {
    document.querySelector('#apYou').style.opacity = '0';
    document.querySelector('#apYou').style.display = 'none';
    document.querySelector('#ytplayer').insertAdjacentHTML('beforeEnd', htmlMobVideoTpl) //append html
  }, 2000)
} else {
  let s = document.createElement('script');
  s.setAttribute('src', 'js/youtubeUP.js');
  document.body.appendChild(s);
}